  false,\n\t\"url\": null,\n\t\"notes\": \"Plot level raw data, including Cover, Woody
  Stem, and Plot/Environmental, datasets from the first year of vegetation sampling
  on Coastal Wetland Elevation Monitoring Sites within the South Atlantic Geography.
  These three tabular datasets represent the raw data collected from vegetation plots
  established at each of the South Atlantic Geography Coastal Wetland Elevation Monitoirng
  Sites in the spring and summer of 2013. There are three sets of tabular data, each
  summarizing information for each of the 60 plots. Dataset include: 1) CWEM_BaselineVeg_Cover:
  cover class values by taxon and nested quadrat depth by taxon; 2) CWEM_BaselineVeg_Stems:
  woody stem counts by diameter class and taxon; and 3) CWEM_BaselineVeg_Plots: plot
  metadata, environmental attributes, and disturbance history.\",\n\t\"license_title\":
